Мы ищем в команду продавца с опытом работы 🌸

Ваши задачи:
 • Консультирование клиентов оффлайн в павильоне;
 • Сбор заказов;
 • Приемка и выкладка товара;
 • Работа с «Мой Склад».

Условия работы:
• Время работы с 9:00 до 17:00;
• График плавающий ❗️Точные выходы каждые субботу и воскресенье. Плюс несколько выходов на неделе (зависит от нагрузки);
• Заработная плата складывается из оклада + % от продаж. 

Очень важно ❗️
• Рассматриваем кандидатов ТОЛЬКО с опытом работы. 

Будет круто, если у вас есть:
• Хорошие коммуникативные навыки, исполнительность, собранность и внимательность;
• Желание работать и зарабатывать;

Для того, чтобы откликнуться на вакансию, напишите в WhatsApp по номеру телефона с коротким резюме (опыт работы, предыдущее место работы, навыки)👇🏻👇🏻👇🏻

